import React from 'react';

const UserForm=(props)=>{
return (
    <form>
        <div className={styles.new-user__controls}>
            <div className={styles.new-us__control}>
            <label>Username</label>
        <input/>
        <input/>
        </div>
        </div>
    </form>
)
}

export default UserForm;
